import React from 'react';
import { Avatar, Typography } from '@mui/material'; // Import from '@mui/material'

const ProfileCard = ({ user }) => {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
      <Avatar alt={user.name} src={user.avatar} sx={{ width: 100, height: 100, marginBottom: 2 }} /> {/* Use 'sx' for styles */}
      <Typography variant="h6" gutterBottom>{user.name}</Typography> {/* Add 'gutterBottom' for spacing */}
      <Typography variant="body1">{user.email}</Typography>
    </div>
  );
};

export default ProfileCard;
